import React from "react";
import { fname, lname } from "./Context";

function Comp2() {
  return (
    <>
      <fname.Consumer>
        {(name) => {
          return (
            <lname.Provider>
              {(name2) => {
                return (
                  <h1>
                    hey hari {name}
                    {name2}
                  </h1>
                )
              }}
              
            </lname.Provider>
          );
        }}
      </fname.Consumer>
    </>
  );
}

export default Comp2;
